import React from 'react';
import { Link } from 'react-router-dom';
import { Formik, Form, Field, ErrorMessage } from 'formik';
import * as Yup from 'yup';
import { HiLightningBolt } from 'react-icons/hi';

const loginSchema = Yup.object().shape({
  email: Yup.string()
    .email('Invalid email address')
    .required('Email is required'),
  password: Yup.string()
    .required('Password is required')
    .min(6, 'Password must be at least 6 characters'),
});

const Login = () => {
  const handleSubmit = (values, { setSubmitting }) => {
    console.log('Login values:', values);
    setTimeout(() => {
      setSubmitting(false);
    }, 1000);
  };
  
  return (
    <div style={{ 
      minHeight: '100vh', 
      display: 'flex', 
      flexDirection: 'column', 
      justifyContent: 'center', 
      padding: '3rem 1.5rem', 
      backgroundColor: 'var(--color-gray-50)' 
    }}>
      <div style={{ 
        maxWidth: '28rem', 
        marginLeft: 'auto', 
        marginRight: 'auto', 
        width: '100%',
        textAlign: 'center'
      }}>
        <div style={{ display: 'flex', justifyContent: 'center' }}>
          <HiLightningBolt size={48} color="var(--color-primary)" />
        </div>
        <h2 style={{ 
          marginTop: '1.5rem', 
          fontSize: '1.875rem', 
          fontWeight: '800',
          color: 'var(--color-gray-900)'
        }}>
          Sign in to your account
        </h2>
        <p style={{ marginTop: '0.5rem', fontSize: '0.875rem', color: 'var(--color-gray-600)' }}>
          Or{' '}
          <Link to="/register" style={{ fontWeight: '500', color: 'var(--color-primary)' }}>
            create a new account
          </Link>
        </p>
      </div>

      <div style={{ 
        marginTop: '2rem', 
        maxWidth: '28rem', 
        marginLeft: 'auto', 
        marginRight: 'auto', 
        width: '100%' 
      }}>
        <div style={{ 
          backgroundColor: 'white', 
          padding: '2rem 1rem', 
          borderRadius: '0.5rem', 
          boxShadow: '0 1px 3px 0 rgba(0, 0, 0, 0.1), 0 1px 2px 0 rgba(0, 0, 0, 0.06)' 
        }}>
          <Formik
            initialValues={{ email: '', password: '' }}
            validationSchema={loginSchema}
            onSubmit={handleSubmit}
          >
            {({ isSubmitting }) => (
              <Form style={{ display: 'flex', flexDirection: 'column', gap: '1.5rem' }}>
                <div>
                  <label 
                    htmlFor="email" 
                    style={{ 
                      display: 'block', 
                      marginBottom: '0.5rem', 
                      fontSize: '0.875rem', 
                      fontWeight: '500', 
                      color: 'var(--color-gray-700)' 
                    }}
                  >
                    Email address
                  </label>
                  <Field
                    id="email"
                    name="email"
                    type="email"
                    autoComplete="email"
                    className="form-input"
                  />
                  <ErrorMessage 
                    name="email" 
                    component="div" 
                    style={{ marginTop: '0.25rem', fontSize: '0.875rem', color: 'var(--color-danger)' }} 
                  />
                </div>

                <div>
                  <label 
                    htmlFor="password" 
                    style={{ 
                      display: 'block', 
                      marginBottom: '0.5rem', 
                      fontSize: '0.875rem', 
                      fontWeight: '500', 
                      color: 'var(--color-gray-700)' 
                    }}
                  >
                    Password
                  </label>
                  <Field
                    id="password"
                    name="password"
                    type="password"
                    autoComplete="current-password"
                    className="form-input"
                  />
                  <ErrorMessage 
                    name="password" 
                    component="div" 
                    style={{ marginTop: '0.25rem', fontSize: '0.875rem', color: 'var(--color-danger)' }} 
                  />
                </div>

                <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
                  <div style={{ display: 'flex', alignItems: 'center' }}>
                    <input
                      id="remember-me"
                      name="remember-me"
                      type="checkbox"
                      style={{ 
                        height: '1rem', 
                        width: '1rem', 
                        color: 'var(--color-primary)', 
                        borderColor: 'var(--color-gray-300)', 
                        borderRadius: '0.25rem' 
                      }}
                    />
                    <label 
                      htmlFor="remember-me" 
                      style={{ 
                        marginLeft: '0.5rem', 
                        fontSize: '0.875rem', 
                        color: 'var(--color-gray-900)' 
                      }}
                    >
                      Remember me
                    </label>
                  </div>

                  <div style={{ fontSize: '0.875rem' }}>
                    <a 
                      href="#" 
                      style={{ 
                        fontWeight: '500', 
                        color: 'var(--color-primary)' 
                      }}
                    >
                      Forgot your password?
                    </a>
                  </div>
                </div>

                <div>
                  <button
                    type="submit"
                    disabled={isSubmitting}
                    className="btn btn-primary"
                    style={{ 
                      width: '100%', 
                      padding: '0.5rem 1rem', 
                      borderRadius: '0.375rem', 
                      fontSize: '0.875rem', 
                      fontWeight: '500',
                      boxShadow: '0 1px 2px 0 rgba(0, 0, 0, 0.05)'
                    }}
                  >
                    {isSubmitting ? 'Signing in...' : 'Sign in'}
                  </button>
                </div>
              </Form>
            )}
          </Formik>
        </div>
      </div>
    </div>
  );
};

export default Login;
